import React from "react";
import { StyledHeader } from "./styles/Header.styled";
import {Button} from './Button.styled';

export default function Header() {
   
    return(
        <>
            <StyledHeader>
              
                    <Nav>
                        <Logo src="./images/logo.svg"  alt=''/>
                        <Button>Try it Free</Button>
                    </Nav>
              
            
            </StyledHeader>
        </>
    )
}
